var isIsomorphic = function(s, t) {
    if (s.length !== t.length) {
        return false
    }

    console.log(s.length);
    console.log(t.length);

    var sChar = [];
    var tChar = [];


    for (var k = 0; k < s.length; k++) {
        if ( k === 0) {
            // sChar.push(s.charCodeAt(k));
            // tChar.push(t.charCodeAt(k));
            sChar.push(0);
            tChar.push(0);
        }
        sChar.push(s.charCodeAt(k) - sChar[0]);
        tChar.push(t.charCodeAt(k) - tChar[0]);
    }

    for (var y = 0; y < sChar.length; y++) {
        if ( !((sChar[y] === sChar[y + 1] && tChar[y] === tChar[y + 1]) || (sChar[y] !== sChar[y + 1] && tChar[y] !== tChar[y + 1])) ) {
            return false;
        }
    }
    return true;

};


